import React, { useEffect } from 'react';

const Friends = () => {
    useEffect(() => {
        fetch('http://127.0.0.1:8000/friends/list', {
            method: 'GET',
            credentials: 'include',
          })
          .then((resp) => {
            return resp.json();
          })
          .then((data) => {
            return console.log(data);
          })
          .catch((err) => {
            return console.error(err);
          })
    }, []);
    return (
        <h1>Friends</h1>
    );
}

export default Friends;
